import { combineReducers } from 'redux';

export const artist = (state = [], action) => {
    switch(action.type) {
        case 'ADD_ARTSIT':
            console.log(action.value)
            console.log([ ...state, action.value ])
            return [ ...state, action.value ]
        default:
            return state
    }
}

export default combineReducers({ artist })
